function Todo({ todo, deleteListHandler, completeListHandler }) {
  return (
    <div className="square-style">
      <div>
        <h2 className="todo-title">{props.todo.title}</h2>
        <div className="todo-body">{props.todo.body}</div>
      </div>
      <div className="button-set">
        <CustomButton color="brown" onClick={() => deleteListHandler(todo.id)}>
          삭제
        </CustomButton>
        <CustomButton
          color="rgb(93, 39, 0)"
          onClick={() => completeListHandler(todo.id)}
        >
          {props.todo.isDone ? "취소" : "완료"}
        </CustomButton>
      </div>
    </div>
  );
}
export default Todo;
